      <text id="83" justification="0" size="4" underlined="false">
        <text>Plapi! Jme suis dit que c&apos;était cool de faire des beaux diagrammes :)
En vrai je pense que c&apos;est mieux d&apos;abord de regarder toutes les forces 
qui s&apos;appliquent, et ensuite seulement s&apos;occuper des déplacements qui 
en découlent. Sinon par exemple, en ayant une laison k infini entre deux
particules, elles pourront jamasi bouger, puisqu&apos;une ne peut bouger qu&apos;
en suivant l&apos;arc de cercle permis par l&apos;autre. Non?
Bon, voili voilou, sinon dis-moi ce que t&apos;en penses. J&apos;avoue, je me suis 
inspirée de ce que l&apos;autre gars a fait d&apos;ailleurs ^^</text>
      </text>
